define({"topics" : [{"title":"Date, time settings","shortdesc":"\n                  <p class=\"shortdesc\">Setting functions that operate on date and time values are classified as date and time   settings. They include functions\n                     for specifying the date format, controlling the behavior when   months are added to a date but the resulting date is invalid,\n                     etc.\n                  </p>\n               ","id":"bis_date_time","href":"TA_Automation\/Topics\/bis_date_time.html","menu": {"hasChildren":false,},"tocID":"bis_date_time-d46e39722","next":"bis_date_time-d46e39722",},{"title":"Timing settings","shortdesc":"\n                  <p class=\"shortdesc\">Setting functions that operate on timing are classified as timing settings. They include   functions for handling timing issues\n                     arising when window or web pages take an unexpected amount of   time to display (from the point of view of the automation).\n                  </p>\n               ","id":"bis_timing","href":"TA_Automation\/Topics\/bis_timing.html","menu": {"hasChildren":false,},"tocID":"bis_timing-d46e39765","next":"bis_timing-d46e39765",},{"title":"Value settings","shortdesc":"\n                  <p class=\"shortdesc\">Built-in settings that operate on displayed values are classified as value settings.   They include functions for ignoring\n                     case sensitivity in string comparison, trimming white spaces   from the beginnings and ends of strings, etc.\n                  </p>\n               ","id":"bis_value","href":"TA_Automation\/Topics\/bis_value.html","menu": {"hasChildren":false,},"tocID":"bis_value-d46e39905","next":"bis_value-d46e39905",},{"title":"Other settings","shortdesc":"\n                  <p class=\"shortdesc\">A hodge-podge of built-in settings that don&apos;t fit into any other categories. Includes   settings for loading visible controls,\n                     setting the default web browser, etc.\n                  </p>\n               ","id":"bis_others","href":"TA_Automation\/Topics\/bis_other.html","menu": {"hasChildren":false,},"tocID":"bis_others-d46e39990","next":"bis_others-d46e39990",},{"title":"Playback settings ","shortdesc":"\n                  <p class=\"shortdesc\">Settings that operate on         CodedUIâ€™s         value are classified as playback settings.</p>\n               ","id":"bis_playback_settings","href":"TA_Automation\/Topics\/bis_playback_setting.html","menu": {"hasChildren":false,},"tocID":"bis_playback_settings-d46e40217","next":"bis_playback_settings-d46e40217",},{"title":"Deprecated","shortdesc":"\n                  <p class=\"shortdesc\">Deprecated built-in settings include those settings which should be avoided, typically     because they have been superseded.</p>\n               ","id":"reference_vlb_gzm_gq","href":"TA_Automation\/Topics\/bis_deprecated.html","menu": {"hasChildren":false,},"tocID":"reference_vlb_gzm_gq-d46e40248","next":"reference_vlb_gzm_gq-d46e40248",}]});